Here's a solution for your problem using TypedArray and Bitwise operations:

```javascript
function packEntities(entities) {
  const buffer = new Uint16Array(Math.ceil(entities.length / 2));

  let offset = 0;
  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id & 0xF; // masking to get 4 bits
    const size = (entity.size & 0x7) << 3; // shifting and masking to get 3 bits

    buffer[offset] = (id << 12) | (size << 9); // packing id and size into one 16-bit value
    offset++;
  }

  return buffer.buffer;
}

function unpackEntities(buffer, length) {
  const entities = [];
  let offset = 0;

  while (offset < length) {
    const value = new Uint16Array(buffer, offset, 1)[0];
    const id = (value >> 12) & 0xF; // masking to get 4 bits
    const size = (value >> 9) & 0x7; // masking to get 3 bits

    entities.push({ id, size });
    offset++;
  }

  return entities;
}
```

In the `packEntities` function, we create a Uint16Array to store the packed data. We then loop through the entities, pack each one into a 16-bit value, and store it in the array.

In the `unpackEntities` function, we create an empty array to store the unpacked entities. We then loop through the buffer, unpack each 16-bit value into an entity, and push it into the array.

The `id` and `size` fields are packed and unpacked using bitwise operations. The `&` operator is used for masking to get the desired number of bits, and the `>>` operator is used for shifting the bits to the appropriate position.

